import React from 'react';
import s from './CalcOperation.module.scss'
import { ItemTypes, ModeType } from '../Calculator';

type CalcOperationType = {
    board: ModeType
    draggable: boolean
    item: ItemTypes
    setCurrentBoard: (board: null | ModeType) => void
    setCurrentItem: (item: null | ItemTypes) => void

}

export const CalcOperation = ({ }: CalcOperationType) => {
    return (
        <div className={s.op_wrapper} draggable={true}>
            <div className={s.op_but}>/</div>
            <div className={s.op_but}>x</div>
            <div className={s.op_but}>-</div>
            <div className={s.op_but}>+</div>
        </div>

    );
}
